import React from 'react';
import './player.css';

const Player = ({ position }) => {
const cellSize = 50;
const x = ((position - 1) % 10) * cellSize;
const y = Math.floor((position - 1) / 10) * cellSize;
return (
<div className="player" style={{ left: x, bottom: y }}></div>
);
};

export default Player;
